svg.script:
webMI.addEvent("", ["mouseup","mouseout","touchend","touchmove"], function(e) {
var id = "";
var value = true;
return function(value) {
	release();
} (value);
});

webMI.addEvent("", ["mousedown","touchstart"], function(e) {
var id = "";
var value = true;
return function(value) {
		if (active) webMI.gfx.setStroke("button_stroke", strokePressed);
} (value);
});

webMI.addEvent("", ["click","touchstart"], function(e) {
var id = "";
var value = true;
return function(value) {
	if (active) tabHandler.setCurrentIndex(keyHandler);
	clickFunction(true);
} (value);
});
